import React from 'react';
import './App.css';

class App extends React.Component{
  render(){
    return(
      <div>
        <h1>Hello User :)</h1>
        <form>
          <input type ="text"  onChange ={this.handleChange}/>
        </form>
      </div>
    )
  }
}



export default App;
